    "content": "Human Sample Metadata Convention\n\nStatus of this Convention\n\nThis document provides guidelines for annotating human-specific metadata in SDRF-Proteomics format. These conventions apply to all human samples, including both clinical studies and healthy individuals.\n\nVersion 1.0.0 - 2025-01\n\nAbstract\n\nHuman-specific metadata is crucial for interpreting proteomics data from human samples, enabling stratification by clinical and demographic characteristics and integration with other biomedical datasets. This convention defines standardized approaches for annotating human-specific metadata:\n\n- Disease staging and grading\n- Pre-existing conditions and comorbidities\n- Treatment and medication history\n- Individual/patient identifiers\n- Additional clinical metadata (BMI, lifestyle factors, reproductive status)\n\nFor general sample metadata conventions (age, biological sex, basic disease annotation) that apply to all organisms, see Sample Metadata Conventions.\n\nDisease Staging and Grading\n\nDisease staging and grading are primarily used for human cancers and other progressive diseases.\n\nDisease Stage\n\nColumn\n\ncharacteristics[disease stage]\n\nOntology\n\n- Primary: NCI Thesaurus (NCIT)\n- Alternative: EFO\n\nStandard Values\n\nValue |NCIT ID |Description\n\nstage I\nNCIT:C27966\nEarly localized disease\n\nstage II\nNCIT:C28054\nLocally advanced\n\nstage III\nNCIT:C27970\nRegional spread\n\nstage IV\nNCIT:C27971\nDistant metastasis\n\nearly\n\nGeneral early stage\n\nadvanced\n\nGeneral advanced stage\n\nlocalized\nNCIT:C68804\nConfined to primary site\n\nmetastatic\nNCIT:C14174\nHas spread to distant sites\n\nnot available\n\nStage unknown\n\nnot applicable\n\nStaging not relevant (non-cancer)\n\nCancer-Specific Staging\n\nTNM Staging\n\nColumn\n\ncharacteristics[TNM staging]\n\nOntology\n\n- Primary: NCI Thesaurus (NCIT)\n\nFormat\n\nT{0-4}N{0-3}M{0-1}\n\nComponents:\n\n- T: Primary tumor size/extent (T0-T4, Tis for in situ)\n- N: Regional lymph node involvement (N0-N3)\n- M: Distant metastasis (M0, M1)\n\nPrefix p indicates pathological staging (e.g",
